import styled from "styled-components";

export const Container = styled.div`
  background-color: #17181F;
  color: #797A81;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
`;

export const Area = styled.div`
  margin: auto;
  max-width: 980px;
  width: 100%;
  padding: 10px;
`;

export const Header = styled.h1`
  margin: 0;
  padding: 0;
  color: #FFF;
  text-align: center;
  border-bottom: 1px solid #444;
  padding-bottom: 20px;
`;
